import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import ImpalasLogo from 'Durban-Impalas/Images/';

function Head() {
  return (
    <head>
        <title> Durban Impalas</title>
        <meta charset="UTF-8" />
        <meta name="Description" content="Single Page Application(SPA) for the durban native rugby team. For access for public and clients" />
        <meta name="Keywords" content = "Rugby, Sports, Marketplace" />
        <meta name="Author" content="Randall Holmes" />
        <link rel="stylesheet" type="text/css" href="index.css" />
        <script type="text/javascript" src="index.js"></script>
    </head>
  )
 }


function NavBar() {
  return (
    <nav class="barnav">
      {/* <img src="Photos/logos/Durban_Impalas.png", width="66", height="66", alt="Logo"> */}
      <h3>Durban Impalas</h3>
      <a href="#About">About Us</a>    
      <a href="#Media">Media</a>
      <a href="#Standings/Game Score">Standings/Game Score</a>
      <a href="#Statistics">Statistics</a>
      <a href="#Marketplace">Marketplace</a>
      <a href="#About">Contact Us</a>
  </nav>

  )
}

ReactDOM.render(<Head />,document.getElementById("root"))
